import React from "react";

export default function SunriseSunset() {
  return (
   <div className="row">
    <div className="col-2"></div>
    <div className="col-2"></div>
    <div className="col-2" id="sunrise">
      <img id="sunrise-image" src="images/SUNRISE.png" />
      <br/>
       <span id="sunrise-time">5:00</span>
    </div>
    <div className="col-2" id="sunset">
      <img id="sunset-image" src="images/SUNSET.png" />
      <br/>
       <span id="sunset-time">20:00</span>
  </div> 
  </div>
  );
}
